@import '../../css/element.scss';
.panel{
    @include panel;
    margin-bottom: 100px;
    >h4{
        display: none;
    }
    .content{
        @include flex;
        .user{
            @include flex(row);
            justify-content: space-around;
            height: 100px;
            line-height: 100px;
            img{
                width: 40px;
                height: 40px;
                margin-top: 30px;
                padding-left: 25px;
                padding-right: 30px;
            }
            span{
                font-size: 32px;
            }
            .name{
                flex: 2;
                color: #666;
            }
            .out{
                padding-right: 25px;
                color: #666;
                font-size: 28px;
            }
        }
    }
}
